import React, { Component } from 'react'
import { Routes, Route } from 'react-router-dom'
import Header from './Components/Header'
export class App extends Component {
  render() {
    return (
      <div>
        <Header></Header>
        <Routes>
          <Route></Route>
        </Routes>
      </div>
    )
  }
}

export default App
